import React from "react";
import { PDFViewer, Page, Document, pdfjs  } from '@react-pdf/renderer';
// import { RPConfig, RPProvider, RPDefaultLayout, RPPages } from "@pdf-viewer/react";

function LectionPage() {
  return (
    <PDFViewer height="949" width="1900">
      <Document file={"test.pdf"}>
        <Page>
          <View>
            <Text>wdad</Text>
          </View>
        </Page>
      </Document>
    </PDFViewer>
  );
}

export default LectionPage;
